import Slider from './Slider';
import Sidebar from './Sidebar';

class Formulario extends Component {
    render() {

        return (
            <div id="formulario">

                <Slider
                    title="Formulario"
                    size="slider-small"
                />
                <div className="center">
                    <div id="content">
                        {/*listado de articulos que vendran del API*/}

                    </div>

                    <Sidebar
                        blog="false" />

                </div>
            </div>

        );
    }
}

export default Formulario;
